-- TOC entry 307 (class 1255 OID 44545)
-- Name: add_bot_network_config_v2(uuid, uuid, boolean, boolean, integer, jsonb, jsonb, jsonb, jsonb, jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.add_bot_network_config_v2(p_bot_id uuid, p_network_id uuid, p_is_active boolean DEFAULT true, p_is_primary boolean DEFAULT false, p_priority integer DEFAULT 0, p_config jsonb DEFAULT '{}'::jsonb, p_api_settings jsonb DEFAULT '{}'::jsonb, p_contract_addresses jsonb DEFAULT '{}'::jsonb, p_gas_settings jsonb DEFAULT '{}'::jsonb, p_monitoring_settings jsonb DEFAULT '{}'::jsonb) RETURNS uuid
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_config_id UUID;
    v_network_name VARCHAR;
    v_network_type VARCHAR;
    v_rpc_url VARCHAR;
    v_new_config JSONB;
BEGIN
    -- 生成新的配置ID
    v_config_id := gen_random_uuid();
    
    -- 获取网络信息
    SELECT name, network_type, rpc_url 
    INTO v_network_name, v_network_type, v_rpc_url
    FROM tron_networks 
    WHERE id = p_network_id AND is_active = true;
    
    IF NOT FOUND THEN
        RAISE EXCEPTION '网络不存在或未激活: %', p_network_id;
    END IF;
    
    -- 构建新的网络配置
    v_new_config := jsonb_build_object(
        'id', v_config_id,
        'network_id', p_network_id,
        'network_name', v_network_name,
        'network_type', v_network_type,
        'rpc_url', v_rpc_url,
        'is_active', p_is_active,
        'is_primary', p_is_primary,
        'priority', p_priority,
        'config', p_config,
        'api_settings', p_api_settings,
        'contract_addresses', p_contract_addresses,
        'gas_settings', p_gas_settings,
        'monitoring_settings', p_monitoring_settings,
        'last_sync_at', NULL,
        'sync_status', 'pending',
        'error_count', 0,
        'last_error', NULL,
        'last_error_at', NULL,
        'created_at', NOW(),
        'updated_at', NOW()
    );
    
    -- 如果设置为主要网络，先取消其他主要网络
    IF p_is_primary THEN
        UPDATE telegram_bots 
        SET network_configurations = (
            SELECT jsonb_agg(
                CASE 
                    WHEN (config->>'network_id')::UUID = p_network_id 
                    THEN jsonb_set(config, '{is_primary}', 'false')
                    ELSE config
                END
            )
            FROM jsonb_array_elements(network_configurations) AS config
        )
        WHERE id = p_bot_id;
    END IF;
    
    -- 添加新的网络配置
    UPDATE telegram_bots 
    SET network_configurations = 
        COALESCE(network_configurations, '[]'::jsonb) || v_new_config::jsonb,
        updated_at = NOW()
    WHERE id = p_bot_id;
    
    RETURN v_config_id;
END;
$$;


--
-- TOC entry 303 (class 1255 OID 44491)
-- Name: cleanup_old_config_history(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.cleanup_old_config_history() RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_deleted_count INTEGER;
BEGIN
    DELETE FROM system_config_history 
    WHERE created_at < NOW() - INTERVAL '6 months'
        AND severity NOT IN ('error', 'critical');
    
    GET DIAGNOSTICS v_deleted_count = ROW_COUNT;
    
    RETURN v_deleted_count;
END;
$$;


--
-- TOC entry 299 (class 1255 OID 44390)
-- Name: cleanup_old_config_logs(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.cleanup_old_config_logs(days_to_keep integer DEFAULT 30) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    deleted_count INTEGER;
BEGIN
    DELETE FROM config_change_logs 
    WHERE created_at < CURRENT_TIMESTAMP - INTERVAL '1 day' * days_to_keep;
    
    GET DIAGNOSTICS deleted_count = ROW_COUNT;
    
    -- 同时清理已处理的通知记录
    DELETE FROM config_change_notifications 
    WHERE status = 'sent' 
      AND created_at < CURRENT_TIMESTAMP - INTERVAL '1 day' * (days_to_keep / 2);
    
    RETURN deleted_count;
END;
$$;


