CREATE FUNCTION public.log_config_change(p_entity_type character varying, p_entity_id uuid, p_operation_type character varying, p_field_name character varying DEFAULT NULL::character varying, p_old_value jsonb DEFAULT NULL::jsonb, p_new_value jsonb DEFAULT NULL::jsonb, p_change_reason text DEFAULT NULL::text, p_user_id uuid DEFAULT NULL::uuid, p_user_type character varying DEFAULT 'system'::character varying, p_ip_address inet DEFAULT NULL::inet, p_user_agent text DEFAULT NULL::text, p_session_id character varying DEFAULT NULL::character varying, p_request_id character varying DEFAULT NULL::character varying, p_severity character varying DEFAULT 'info'::character varying, p_tags jsonb DEFAULT '[]'::jsonb, p_metadata jsonb DEFAULT '{}'::jsonb) RETURNS uuid
    LANGUAGE plpgsql
    AS $$
