    v_history_id UUID;
BEGIN
    INSERT INTO system_config_history (
        entity_type, entity_id, operation_type, field_name,
        old_value, new_value, change_reason, user_id, user_type,
        ip_address, user_agent, session_id, request_id,
        severity, tags, metadata
    ) VALUES (
