--
-- TOC entry 298 (class 1255 OID 44385)
-- Name: notify_config_change(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.notify_config_change() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    old_data JSONB;
    new_data JSONB;
    changed_fields TEXT[];
    notification_payload JSONB;
BEGIN
    -- 根据操作类型设置数据
    IF TG_OP = 'DELETE' THEN
        old_data := to_jsonb(OLD);
        new_data := NULL;
        changed_fields := NULL;
    ELSIF TG_OP = 'INSERT' THEN
        old_data := NULL;
        new_data := to_jsonb(NEW);
        changed_fields := NULL;
    ELSE -- UPDATE
        old_data := to_jsonb(OLD);
        new_data := to_jsonb(NEW);
        
        -- 计算变更的字段
        SELECT array_agg(key) INTO changed_fields
        FROM (
            SELECT key
            FROM jsonb_each(old_data) old_kv
            FULL OUTER JOIN jsonb_each(new_data) new_kv USING (key)
            WHERE old_kv.value IS DISTINCT FROM new_kv.value
        ) changed;
    END IF;
    
    -- 记录变更日志
    INSERT INTO config_change_logs (
        table_name,
        record_id,
        action,
        old_data,
        new_data,
        changed_fields
    ) VALUES (
        TG_TABLE_NAME,
        COALESCE(NEW.id, OLD.id),
        TG_OP,
        old_data,
        new_data,
        changed_fields
    );
    
    -- 构建通知载荷
    notification_payload := jsonb_build_object(
        'table_name', TG_TABLE_NAME,
        'record_id', COALESCE(NEW.id, OLD.id),
        'action', TG_OP,
        'changed_fields', changed_fields,
        'timestamp', CURRENT_TIMESTAMP
    );
    
    -- 添加具体数据（根据需要）
    IF TG_OP != 'DELETE' THEN
        notification_payload := notification_payload || jsonb_build_object('new_data', new_data);
    END IF;
    
    IF TG_OP != 'INSERT' THEN
        notification_payload := notification_payload || jsonb_build_object('old_data', old_data);
    END IF;
    
    -- 创建通知记录
    INSERT INTO config_change_notifications (
        table_name,
        record_id,
        action,
        payload
    ) VALUES (
        TG_TABLE_NAME,
        COALESCE(NEW.id, OLD.id),
        TG_OP,
        notification_payload
    );
    
    -- 发送PostgreSQL通知
    PERFORM pg_notify('config_change', notification_payload::text);
    
    RETURN COALESCE(NEW, OLD);
END;
$$;


--
-- TOC entry 309 (class 1255 OID 44547)
-- Name: remove_bot_network_config_v2(uuid, uuid); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.remove_bot_network_config_v2(p_bot_id uuid, p_config_id uuid) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_found BOOLEAN := false;
BEGIN
    UPDATE telegram_bots 
    SET network_configurations = (
        SELECT COALESCE(jsonb_agg(config), '[]'::jsonb)
        FROM jsonb_array_elements(network_configurations) AS config
        WHERE (config->>'id')::UUID != p_config_id
    ),
    updated_at = NOW()
    WHERE id = p_bot_id
    AND EXISTS (
        SELECT 1 FROM jsonb_array_elements(network_configurations) AS config
        WHERE (config->>'id')::UUID = p_config_id
    );
    
    GET DIAGNOSTICS v_found = ROW_COUNT;
    RETURN v_found > 0;
END;
$$;


