--
-- TOC entry 308 (class 1255 OID 44546)
-- Name: update_bot_network_config_v2(uuid, uuid, boolean, boolean, integer, jsonb, jsonb, jsonb, jsonb, jsonb); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.update_bot_network_config_v2(p_bot_id uuid, p_config_id uuid, p_is_active boolean DEFAULT NULL::boolean, p_is_primary boolean DEFAULT NULL::boolean, p_priority integer DEFAULT NULL::integer, p_config jsonb DEFAULT NULL::jsonb, p_api_settings jsonb DEFAULT NULL::jsonb, p_contract_addresses jsonb DEFAULT NULL::jsonb, p_gas_settings jsonb DEFAULT NULL::jsonb, p_monitoring_settings jsonb DEFAULT NULL::jsonb) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_found BOOLEAN := false;
BEGIN
    -- 如果设置为主要网络，先取消其他主要网络
    IF p_is_primary THEN
        UPDATE telegram_bots 
        SET network_configurations = (
            SELECT jsonb_agg(
                CASE 
                    WHEN (config->>'id')::UUID != p_config_id 
                    THEN jsonb_set(config, '{is_primary}', 'false')
                    ELSE config
                END
            )
            FROM jsonb_array_elements(network_configurations) AS config
        )
        WHERE id = p_bot_id;
    END IF;
    
    -- 更新指定的网络配置
    UPDATE telegram_bots 
    SET network_configurations = (
        SELECT jsonb_agg(
            CASE 
                WHEN (config->>'id')::UUID = p_config_id THEN
                    config ||
                    jsonb_strip_nulls(jsonb_build_object(
                        'is_active', p_is_active,
                        'is_primary', p_is_primary,
                        'priority', p_priority,
                        'config', p_config,
                        'api_settings', p_api_settings,
                        'contract_addresses', p_contract_addresses,
                        'gas_settings', p_gas_settings,
                        'monitoring_settings', p_monitoring_settings,
                        'updated_at', NOW()
                    ))
                ELSE config
            END
        )
        FROM jsonb_array_elements(network_configurations) AS config
    ),
    updated_at = NOW()
    WHERE id = p_bot_id
    AND EXISTS (
        SELECT 1 FROM jsonb_array_elements(network_configurations) AS config
        WHERE (config->>'id')::UUID = p_config_id
    );
    
    GET DIAGNOSTICS v_found = ROW_COUNT;
    RETURN v_found > 0;
END;
$$;


