--

CREATE FUNCTION public.validate_tron_address(address text) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
BEGIN
    -- TRON地址必须以T开头，长度为34位
    RETURN address ~ '^T[A-HJ-NP-Za-km-z1-9]{33}$';
END;
$_$;


