  IF NEW.created_by IS NOT NULL THEN
    -- 先检查 admins 表
    IF EXISTS (SELECT 1 FROM admins WHERE id = NEW.created_by) THEN
      -- admins 表中找到用户，继续
    ELSE
      -- 检查 telegram_users 表是否存在并查询
