--
-- TOC entry 261 (class 1259 OID 44567)
-- Name: bot_statistics; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.bot_statistics AS
 SELECT tb.id AS bot_id,
    tb.bot_name,
    tb.bot_username,
    tb.is_active AS bot_is_active,
    COALESCE(user_stats.total_users, (0)::bigint) AS total_users,
    COALESCE(user_stats.active_users, (0)::bigint) AS active_users,
    COALESCE(user_stats.inactive_users, (0)::bigint) AS inactive_users,
    COALESCE(order_stats.total_orders, (0)::bigint) AS total_orders,
    COALESCE(order_stats.completed_orders, (0)::bigint) AS completed_orders,
    COALESCE(order_stats.pending_orders, (0)::bigint) AS pending_orders,
    COALESCE(order_stats.cancelled_orders, (0)::bigint) AS cancelled_orders,
    COALESCE(order_stats.total_revenue, (0)::numeric) AS total_revenue,
    tb.created_at AS bot_created_at,
    tb.updated_at AS bot_updated_at
   FROM ((public.telegram_bots tb
     LEFT JOIN ( SELECT users.bot_id,
            count(*) AS total_users,
            count(
                CASE
                    WHEN ((users.status)::text = 'active'::text) THEN 1
                    ELSE NULL::integer
                END) AS active_users,
            count(
                CASE
                    WHEN ((users.status)::text = ANY ((ARRAY['inactive'::character varying, 'banned'::character varying])::text[])) THEN 1
                    ELSE NULL::integer
                END) AS inactive_users
           FROM public.users
          WHERE (users.bot_id IS NOT NULL)
          GROUP BY users.bot_id) user_stats ON ((tb.id = user_stats.bot_id)))
     LEFT JOIN ( SELECT orders.bot_id,
            count(*) AS total_orders,
            count(
                CASE
                    WHEN ((orders.status)::text = 'completed'::text) THEN 1
                    ELSE NULL::integer
                END) AS completed_orders,
            count(
                CASE
                    WHEN ((orders.status)::text = ANY ((ARRAY['pending'::character varying, 'processing'::character varying])::text[])) THEN 1
                    ELSE NULL::integer
                END) AS pending_orders,
            count(
                CASE
                    WHEN ((orders.status)::text = ANY ((ARRAY['cancelled'::character varying, 'failed'::character varying])::text[])) THEN 1
                    ELSE NULL::integer
                END) AS cancelled_orders,
            sum(
                CASE
                    WHEN ((orders.status)::text = 'completed'::text) THEN orders.price
                    ELSE (0)::numeric
                END) AS total_revenue
           FROM public.orders
          WHERE (orders.bot_id IS NOT NULL)
          GROUP BY orders.bot_id) order_stats ON ((tb.id = order_stats.bot_id)))
  ORDER BY tb.created_at DESC;


